import "./App.css";
import Topbar from "./components/Topbar";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Route
        render={({ location }) => (
          <>
            <Navbar location={location} />
            {/* Other components and Routes */}
          </>
        )}
      />
    </BrowserRouter>
  );
}

export default App;
